import React from 'react';
import './login.css';
export default function Login() {
  return (
    <div className='container' style={{borderRadius:'20px' ,border:'1px solid black',width:'1000px'}}>
      <div className="row">
        <div className="col-4" style={{backgroundColor: '#949EFF',borderRadius:'20px',marginLeft:'2px'}}>
            <p className='p1'>Welcome Users</p>
          <img className='imo' src='login.png'></img>
        </div>
        <div className="col-4" style={{borderRadius:'50px',position:'absolute',backgroundColor:'white',marginLeft:'300px'}}>
          One of two columns
        </div>
      </div>
    </div>
  );
}
